var networkFirstFiles = [
  "/",
];

var cacheFiles = cacheFirstFiles.concat(networkFirstFiles);
self.addEventListener("install", e => {
  e.waitUntil(
    caches.open(cacheName).then(cache => {
      return cache.addAll(cacheFiles).then(() => self.skipWaiting());
    })
  );
});

self.addEventListener("activate", event => {
  event.waitUntil(
    caches.keys().then(function(cacheNames) {
      return Promise.all(
        cacheNames
          .filter(function(cacheName) {
            //return true;
            // Return true if you want to remove this cache,
            // but remember that caches are shared across
            // the whole origin
          })
          .map(function(cacheName) {
            return caches.delete(cacheName);
          })
      );
    })
  );
  event.waitUntil(self.clients.claim());
});

self.addEventListener("fetch", event => {

  if(event.request.url.indexOf('analytics') > -1 || event.request.url.indexOf('sock') > -1) {
    try {
      return;
    return fetch(event.request).then(res => {
      return res;
    })
    }catch(e){return;}
  }

  if (event.request.method !== "GET") {
    return;
  }
  if (
    networkFirstFiles.indexOf(event.request.url.replace(BASE_URL, "")) !== -1
  ) {
    try {
      event.respondWith(networkElseCache(event));
    } catch (e) {
      return;
    }
  } else if (
    cacheFirstFiles.indexOf(event.request.url.replace(BASE_URL, "")) !== -1
    //|| event.request.url.indexOf('-ze') > -1
  ) {
    try {
      event.respondWith(cacheElseNetwork(event));
      //event.respondWith(networkElseCache(event));
    } catch (e) {
      return;
    }
  }
  //try {

    //event.respondWith(networkElseCache(event));
    ////event.respondWith(cacheElseNetwork(event));
  //} catch (e) {
  //}
  try {
    event.respondWith(fetch(event.request));
  } catch (e) {
    return;
  }
});

self.addEventListener("push", function(event) {
  const data = event.data.json();
  if (event.data) {
    var promise = self.registration.showNotification(data.title, data.payload);

    event.waitUntil(promise);
  }
});

self.addEventListener("notificationclick", function(event) {
  const data = event.notification.data;
  event.notification.close();
  event.waitUntil(clients.openWindow(data.url + "?push"));
});

